import Layout from "../components/Layout";
import Markdown from 'react-markdown';

export default (props) => (
  <Layout>
    <h1>{props.url.query.title}</h1>
    <div className="markdown">
      <Markdown source={`
        This is a post.
      `}/>
    </div>
    <style jsx global>{`
      .markdown {
        border: 1px solid red;
      }
    `}
    </style>
  </Layout>
);
